function Home() {
  return (
    <div className="font-kanit">
      <Header />
      <CategoryBar />
      <FilterBar />
      <div className="flex justify-center mt-5">
        <div className="grid grid-cols-3 w-4/6">
          <ProductCard />
          <ProductCard />
          <ProductCard />
          <ProductCard />
          <ProductCard />
          <ProductCard />
          <ProductCard />
          <ProductCard />
        </div>
      </div>
      <Login />
    </div>
  );
}

export default Home;
